import React, { Component } from 'react'
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

import './App.css';
import Scorecards from './components/Pages/Scorecards/index';
import Profile from './components/Pages/Profile/index';
import IconProfile from './components/Icons/iconProfile'
import Header from './components/Header/header'

class App extends Component {
  render() {
    const logo = <svg xmlns="http://www.w3.org/2000/svg" width="199" height="43" viewBox="0 0 199 43">
    <g fill="none" fillRule="evenodd" transform="translate(-1 -5)">
      <text fill="#C5AB71" fontFamily="Avenir-Light, Avenir" fontSize="12.6" fontWeight="300" letterSpacing="1.89">
        <tspan x="17.83" y="46.3">BOXING SCORECARD</tspan> <tspan x="176.011" y="46.3" letterSpacing="1.654">S</tspan>
      </text>
      <text fill="#C0A56C" fontFamily="Baskerville" fontSize="27">
        <tspan x="1.272" y="24">FIGHT SCORES</tspan>
      </text>
    </g>
  </svg>
    const profileIcon = <IconProfile />

    return (
      <div>
        <Router>
          <div>
            <Header />

            <Route exact path="/new-scorecard" component={Scorecards} />
            <Route path="/" component={Scorecards} />
            <Route exact path="/profile/" component={Profile} />
          </div>
        </Router>
      </div>
    );
  }
}

export default App;
